class signup extends React.Component {

    render() {
        return (
            <div className= "mainBody">
                <div className="createAccountMain">
                    <h1>Create an Account</h1>
                    <input type="text" placeholder="Username"/>
                    <input type="text" placeholder="Email"/>
                    <input type="text" placeholder="Password"/>
                    <input type="text" placeholder="Re-type Password"/>
                    <button >Signup</button>
                </div>
            <style jsx>{`
                .createAccountMain {
                    width: 40%;
                    height: 80%;
                    background: blue;
                    display: flex;
                    flex-direction: column;
                    align-items: center;
                    border-radius: 25px

                }

                .mainBody {
                    height: 40rem;
                    display: flex;
                    justify-content: center;
                    align-items: center;
                }

                input {
                    height: 2rem;
                    margin-bottom: 2rem;
                    width: 16rem;
                    border-radius: 25px;
                    padding-left: 1rem
                }

                input::placeholder {
                    text-align: center;
                    margin-left: -1rem
                }
                input:focus {
                    outline: none
                }

                button {
                    border-radius: 25px;
                    height: 3rem;
                    width: 10rem;
                    background: none;
                    highlight: none;

                }

                button:focus {
                    outline: none
                }

                h1 {
                    margin-bottom: 3rem;
                    margin-top: 2rem
                }
            `}</style>
            </div>
        )
    }
}

export default signup
